/*
// Dimentions:
// 1. positions (length: resolution)
// 2. strips (length: 4)
// 3. pixels (length: pixelCount, 36)

settings.pixelConfig = [
  // 1st position
  [
    // 1st strip
    [
      [
        {x: 34, y: 76}, // 1st pixel
        {x: 34, y: 76}, // 2nd pixel
      ]
    ],
    // 2nd strip
    [],
    // 3rd strip
    [],
    // 4th strip
    []
  ],
  // 2nd position
  [
    // ...
  ]
];
*/

function Settings(options) {
  var self = this;
  options = options || {};
  var resolution = self.resolution = options.resolution || 256;

  function findDiameter(point, offset) {
    offset = offset || {x: 0, y: 0};
    var x = point.x - offset.x;
    var y = point.y - offset.y;

    return Math.sqrt(x * x + y * y);
  }

  function mapPixels(first, last, length) {
    var deltaX = (last.x - first.x) / (length - 1);
    var deltaY = (last.y - first.y) / (length - 1);

    var pixels = [];

    for (var pixelIndex = 0; pixelIndex < length; pixelIndex++) {
      pixels[pixelIndex] = {
        x: first.x + (pixelIndex * deltaX),
        y: first.y + (pixelIndex * deltaY)
      }
    }

    return pixels;
  }

  function normalizeConfiguration(config) {
    var sourceRadius = Math.max.apply(this, config.strips.map(function(strip) {
      return findDiameter(strip.last, config.center);
    }));
    config.radius = sourceRadius;

    var strips = config.strips.map(function(strip) {
      var first = {
        x: (strip.first.x - config.center.x) / sourceRadius,
        y: (strip.first.y - config.center.y) / sourceRadius
      };

      var last = {
        x: (strip.last.x - config.center.x) / sourceRadius,
        y: (strip.last.y - config.center.y) / sourceRadius
      };

      return {
        length: strip.length,
        first: first,
        last: last,
        pixels: mapPixels(first, last, strip.length)
      }
    });

    return {
      center: {x: 0, y: 0},
      radius: 1,
      strips: strips,
      normalized: true
    };
  }

  function rotateStrip(strip, angle) {
    var pixelDiameter, pixelAngle;

    var pixels = strip.pixels.map(function(pixel) {
      pixelDiameter = findDiameter(pixel);
      pixelAngle    = Math.atan2(pixel.y, pixel.x);

      return {
        x: Math.cos(pixelAngle + angle) * pixelDiameter,
        y: Math.sin(pixelAngle + angle) * pixelDiameter
      }
    });

    return {
      length: strip.length,
      first: pixels[0],
      last: pixels[strip.length - 1],
      pixels: pixels
    }
  }

  self.load = function(config) {
    var normalizedConfig = config.normalized ? config : normalizeConfiguration(config);

    self.configuration = config;
    self.normalizedConfiguration = normalizedConfig;
    self.pixelConfig = [];

    var step, strip, stepAngle;

    for (step = 0; step < resolution; step++) {
      strips = self.pixelConfig[step] = [];
      stepAngle = (-step / resolution) * 2 * Math.PI;

      for (stripIndex = 0; stripIndex < normalizedConfig.strips.length; stripIndex++) {
        strip = normalizedConfig.strips[stripIndex];
        strips[stripIndex] = rotateStrip(strip, stepAngle).pixels;
      }
    }
  }
}

var settings = new Settings({resolution: 256});

settings.load({
  image: {
    url: 'data:image/jpeg;base64,',
    width: 500,
    height: 500
  },
  center: {x: 260, y: 247},
  strips: [
    {
      length: 35,
      first: {x: 260, y: 210},
      last:  {x: 335, y: 54}
    },
    {
      length: 36,
      first: {x: 300, y: 245},
      last:  {x: 469, y: 293}
    },
    {
      length: 36,
      first: {x: 232, y: 282},
      last:  {x: 172, y: 456}
    },
    {
      length: 36,
      first: {x: 222, y: 226},
      last:  {x: 33,   y: 198}
    }
  ]
});
